import React from 'react';
import { CircularProgressBar } from "@tomik23/react-circular-progress-bar";

const App = () => {
    const props = {
        percent: 90, // is require
        colorSlice: "#00a1ff",
        colorCircle: "#00a1ff",
        fontColor: "#365b74",
        fontSize: "1.6rem",
        fontWeight: 400,
        size: 200,
        stroke: 5,
        strokeBottom: 50,
        speed: 60,
        cut: 0,
        rotation: -90,
        opacity: 10,
        fill: "#00897B",
        unit: "%",
        textPosition: "0.35em",
        animationOff: false,
        // inverse: false,
        round: false,
        // number: true,
        // linearGradient: ["#ffff00", "brown"]
      };
    return (
        <>
            <CircularProgressBar {...props} />
        </>
    )
}

export default App
